// app/screens/Home/styles.js
import { StyleSheet } from 'react-native';

export default StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#f5f5f5',
  },
  content: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  textoBoasVindas: {
    fontSize: 20,
    fontWeight: 'bold',
    color: '#333',
  },
});
